import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render(){
    return(
      <div className="App">
        <h1 className="Texto">Hello World</h1>,
        <h1>Ola mundo</h1>
      </div>
    )
  }
}

export default App;
